script: |
  super -f tsv -I q11030.sql | sort > q11030.out

vector: true

inputs:
  - name: q11030.sql
    data: |
      SELECT ALL 80 + - + col1 * - + col0 AS col2 FROM tab1 WHERE + + col1 + col1 + col1 NOT BETWEEN 35 AND col2 * + ( + + col0 ) * - - col2 + 64 - col2 + col1;
  - name: tab1

outputs:
  - name: q11030.out
    data: |
      505
